import React from 'react';

const Students = ({ students}) => {
  return (
  <div>
  <h1>Students </h1>
  {students.map((student, index)=> (
  <div key={index}>
  <li>
  <h3> Name: {student}</h3>
  </li>
  </div>
)
)}
</div>
)
};

export default Students;
